/* nnom model */
static int8_t nnom_input_data[40];
static int8_t nnom_output_data[6];
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[4];

	new_model(&model);

	layer[0] = Input(shape(40,1,1), nnom_input_data);
	layer[1] = model.hook(Dense(32, &dense_w, &dense_b), layer[0]);
	layer[2] = model.hook(Dense(6, &dense_1_w, &dense_1_b), layer[1]);
	layer[3] = model.hook(Output(shape(6,1,1), nnom_output_data), layer[2]);
	model_compile(&model, layer[0], layer[3]);
	return &model;
}
